e19 when o.sortOrder = 20 then atr.scoreValue20 else null end else null end) value , case when r.includeAlliancePts = 'Y' then coalesce(atr.portionOfAlliancePoints, 0) else 0 end portionOfAlliancePoints , tge.rank , tge.rankingPointAverage , tge.id teamGameEventId , coalesce(tge.selectedForPlayoff, 'N') selectedForPlayoff , tge.oPR , coalesce(tge.playoffAlliance, 0) playoffAlliance from rank r inner join RankObjective ro on ro.rankId = r.id inner join Objective o on o.id = ro.objectiveId inner join v_GameEvent ge on ge.gameId = o.gameId inner join TeamGameEvent tge on ge.id = tge.gameEventId inner join v_AvgTeamRecord atr on atr.teamId = tge.teamId and atr.loginGUID = ge.loginGUID where ge.loginGUID = @pv_loginGUID group by atr.teamId , r.gameId , r.name , r.sortOrder , atr.cntMatches , r.includeAlliancePts , atr.portionOfAlliancePoints , tge.rank , tge.rankingPointAverage , tge.id , tge.selectedForPlayoff , tge.oPR , tge.playoffAlliance;
-- Add teams that do not have a scout record yet INSERT INTO #AvgTeamRecord select tge.teamId , r.gameId , r.name rankName , r.sortOrder , 0 cntMatches , 0 value , 0 portionOfAlliancePoints , tge.rank , tge.rankingPointAverage , tge.id teamGameEventId , coalesce(tge.selectedForPlayoff, 'N') selectedForPlayoff , tge.oPR , coalesce(tge.playoffAlliance, 0) playoffAlliance from rank r inner join v_GameEvent ge on ge.gameId = r.gameId inner join TeamGameEvent tge on tge.gameEventId = ge.id where ge.loginGUID = @pv_loginGUID and not exists (select 1 from #AvgTeamRecord atr where atr.TeamId = tge.teamId);
/* Causes data to not display on website? -- Update Scoring Impact for Teams update tge set scoringRank = subquery.rank , scoringAverage = subquery.value from TeamGameEvent tge inner join (select atr.teamGameEventId , atr.value , (select count(*) from #AvgTeamRecord atr2 where atr2.gameId = atr.gameId and atr2.rankName = atr.rankName and atr2.sortOrder = atr.sortOrder and atr2.value > atr.value) + 1 rank from #AvgTeamRecord atr where atr.rankName = 'Scr Imp') subquery on subquery.teamGameEventId = tge.id; */
-- Use temporary table to return rankings and average values select subquery.teamId , t.TeamNumber , t.TeamName , subquery.cntMatches , avg(subquery.rank) avgRank , sum(case when subquery.sortOrder = 1 then subquery.rank else null end) rankValue1 , sum(case when subquery.sortOrder = 2 then subquery.rank else null end) rankValue2 , sum(case when subquery.sortOrder = 3 then subquery.rank else null end) rankValue3 , sum(case when subquery.sortOrder = 4 then subquery.rank else null end) rankValue4 , sum(case when subquery.sortOrder = 5 then subquery.rank else null end) rankValue5 , sum(case when subquery.sortOrder = 6 then subquery.rank else null end) rankValue6 , sum(case when subquery.sortOrder = 7 then subquery.rank else null end) rankValue7 , sum(case when subquery.sortOrder = 8 then subquery.rank else null end) rankValue8 , sum(case when subquery.sortOrder = 9 then subquery.rank else null end) rankValue9 , sum(case when subquery.sortOrder = 10 then subquery.rank else null end) rankValue10 , sum(case when subquery.sortOrder = 1 then subquery.value else null end) value1 , sum(case when subquery.sortOrder = 2 then subquery.value else null end) value2 , sum(case when subquery.sortOrder = 3 then subquery.value else null end) value3 , sum(case when subquery.sortOrder = 4 then subquery.value else null end) value4 , sum(case when subquery.sortOrder = 5 then subquery.value else null end) value5 , sum(case when subquery.sortOrder = 6 then subquery.value else null end) value6 , sum(case when subquery.sortOrder = 7 then subquery.value else null end) value7 , sum(case when subquery.sortOrder = 8 then subquery.value else null end) value8 , sum(case when subquery.sortOrder = 9 then subquery.value else null end) value9 , sum(case when subquery.sortOrder = 10 then subquery.value else null end) value10 , subquery.eventRank , subquery.rankingPointAverage , subquery.teamGameEventId , subquery.selectedForPlayoff , subquery.oPR , subquery.playoffAlliance , rp.rp1TableHeader , rp.rp1Total , rp.rp2TableHeader , rp.rp2Total , rp.rp3TableHeader , rp.rp3Total , rp.coopTableHeader , rp.coopTotal from ( select atr.teamId , atr.gameId , atr.rankName , atr.sortOrder , atr.cntMatches , atr.value + atr.portionOfAlliancePoints value , (select count(*) from #AvgTeamRecord atr2 where atr2.gameId = atr.gameId and atr2.rankName = atr.rankName and atr2.sortOrder = atr.sortOrder and coalesce(atr2.value + atr2.portionOfAlliancePoints, 0) > coalesce(atr.value + atr.portionOfAlliancePoints, 0)) + 1 rank , atr.rank eventRank , atr.rankingPointAverage , atr.teamGameEventId , atr.selectedForPlayoff , atr.oPR , atr.playoffAlliance from #AvgTeamRecord atr) subquery inner join Team t on t.id = subquery.teamId inner join ( select tm.teamId , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 1) rp1TableHeader , coalesce( sum(case when tm.alliance = 'R' then m.redRP1 else m.blueRP1 end) , 0) rp1Total , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 2) rp2TableHeader , coalesce( sum(case when tm.alliance = 'R' then m.redRP2 else blueRP2 end) , 0) rp2Total , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 3) rp3TableHeader , coalesce( sum(case when tm.alliance = 'R' then m.redRP3 else m.blueRP3 end) , 0) rp3Total , case when g.tbaCoopMet is not null then 'Coop' else null end coopTableHeader , coalesce( sum(case when tm.alliance = 'R' then m.redCoop else m.blueCoop end) , 0) coopTotal from Game g inner join v_GameEvent ge on ge.gameId = g.id inner join Match m on m.gameEventId = ge.id inner join TeamMatch tm on tm.matchId = m.id where ge.loginGUID = @pv_loginGUID group by g.id, g.tbaCoopMet, tm.teamId union select tge.teamId , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 1) rp1TableHeader , 0 rp1Total , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 2) rp2TableHeader , 0 rp2Total , (select grp.tableHeader from GameRankingPoint grp where grp.gameId = g.id and grp.sortOrder = 3) rp3TableHeader , 0 rp3Total , case when g.tbaCoopMet is not null then 'Coop' else null end coopHeader , 0 coopTotal from Game g inner join v_GameEvent ge on ge.gameId = g.id inner join TeamGameEvent tge on tge.gameEventId = ge.id where ge.loginGUID = @pv_loginGUID and not exists (select 1 from Match m inner join TeamMatch tm on tm.matchId = m.id where m.gameEventId = ge.id and tm.teamId = tge.teamId) group by g.id, g.tbaCoopMet, tge.teamId, ge.id) rp on rp.teamId = t.id group by subquery.teamId , t.TeamNumber , t.TeamName , subquery.TeamId , subquery.cntMatches , subquery.eventRank , subquery.rankingPointAverage , subquery.teamGameEventId , subquery.selectedForPlayoff , subquery.oPR , subquery.playoffAlliance , rp.rp1TableHeader , rp.rp1Total , rp.rp2TableHeader , rp.rp2Total , rp.rp3TableHeader , rp.rp3Total , rp.coopTableHeader , rp.coopTotal order by subquery.selectedForPlayoff , subquery.playoffAlliance , case when @lv_SortOrder = -98 and subquery.teamId = @lv_TeamId then 0 else 1 end , case when @lv_SortOrder = -98 then t.teamNumber when @lv_SortOrder = -99 then coalesce(subquery.eventRank, 999) else sum(case when subquery.sortOrder = @lv_SortOrder then subquery.rank else null end) end , case when @lv_SortOrder = -98 then 1 else t.teamNumber end;
END

begin SET NOCOUNT ON -- If year is 2020, allocate balanced hang points if @pv_GameYear = 2020 begin -- Clear all portioning of points update TeamMatch set portionOfAlliancePoints = null where portionOfAlliancePoints is not null and id in (select tm.id from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId);
-- Set portion to zero if team did not hang update TeamMatch set portionOfAlliancePoints = 0 where coalesce(portionOfAlliancePoints, -1) <> 0 and id in (select tm.id from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId) and not exists (select 1 from TeamMatchObjective tmo inner join Objective o on o.id = tmo.objectiveId inner join Match m on m.id = TeamMatch.matchId where m.gameEventId = @pv_GameEventId and tmo.teamMatchId = TeamMatch.id and o.addTeamScorePortion = 'Y' and tmo.scoreValue = 25); -- Indicates hang at end
-- Set portion to alliance score divide by teams hanging update TeamMatch set portionOfAlliancePoints = convert(numeric(10,3), (select case when TeamMatch.alliance = 'R' then m.redAlliancePoints when TeamMatch.alliance = 'B' then m.blueAlliancePoints else 0 end from Match m where m.id = TeamMatch.matchId)) / convert(numeric(10,3), (select count(*) from TeamMatch tm where tm.matchId = TeamMatch.matchId and tm.alliance = TeamMatch.alliance and tm.portionOfAlliancePoints is null)) where coalesce(portionOfAlliancePoints, -1) <> 0 and id in (select tm.id from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId); end -- If year is 2023, allocate link points if @pv_GameYear = 2023 begin -- Clear all portioning of points update tm set portionOfAlliancePoints = null , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is not null;
-- Set portion to zero if alliance didn't have any links update tm set portionOfAlliancePoints = 0 , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end = 0;
-- Set portion to zero if team didn't place any game pieces update tm set portionOfAlliancePoints = 0 , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId inner join v_TeamScorePortion tsp on tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid and tsp.teamId = tm.teamId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and tsp.intTeamScorePortion = 0; -- Indicates no game piece placed
-- Set portion to alliance score to ratio of team game pieces to alliance game peices update tm set portionOfAlliancePoints = convert(numeric, case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end) * convert(numeric, tsp.intTeamScorePortion) / convert(numeric, (select sum(tsp2.intTeamScorePortion) from v_TeamScorePortion tsp2 where tsp2.gameEventId = tsp.gameEventId and tsp2.matchId = tsp.matchid and tsp2.alliance = tsp.alliance)) , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId inner join v_TeamScorePortion tsp on tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid and tsp.teamId = tm.teamId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and tsp.intTeamScorePortion > 0; -- Indicates at least one game piece placed
-- Set portion to alliance score to ratio of teams if no scout data shows game peices update tm set portionOfAlliancePoints = convert(numeric, case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end) * 1.0 / convert(numeric, (select count(*) from TeamMatch tm2 where tm2.matchId = tm.matchId and tm2.alliance = tm.alliance)) , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end > 0 and (select sum(tsp.intTeamScorePortion) from v_TeamScorePortion tsp where tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid) = 0; end -- If year is 2024, allocate amplification points if @pv_GameYear = 2024 begin -- Clear all portioning of points update tm set portionOfAlliancePoints = null , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is not null;
-- Set portion to zero if alliance didn't have any amplification points update tm set portionOfAlliancePoints = 0 , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end = 0;
-- Set portion to zero if team didn't score any TeleOp Speaker or Amp update tm set portionOfAlliancePoints = 0 , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId inner join v_TeamScorePortion tsp on tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid and tsp.teamId = tm.teamId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and tsp.intTeamScorePortion = 0; -- Indicates no game piece placed
-- Set portion to alliance score to ratio of team game pieces to alliance game peices update tm set portionOfAlliancePoints = convert(numeric, case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end) * convert(numeric, tsp.intTeamScorePortion) / convert(numeric, (select sum(tsp2.intTeamScorePortion) from v_TeamScorePortion tsp2 where tsp2.gameEventId = tsp.gameEventId and tsp2.matchId = tsp.matchid and tsp2.alliance = tsp.alliance)) , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId inner join v_TeamScorePortion tsp on tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid and tsp.teamId = tm.teamId where m.gameEventId = @pv_GameEventId and portionOfAlliancePoints is null and tsp.intTeamScorePortion > 0; -- Indicates at least one game piece placed
-- Set portion to alliance score to ratio of teams if no scout data shows game peices update tm set portionOfAlliancePoints = convert(numeric, case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end) * 1.0 / convert(numeric, (select count(*) from TeamMatch tm2 where tm2.matchId = tm.matchId and tm2.alliance = tm.alliance)) , lastUpdated = getdate() from TeamMatch tm inner join Match m on m.id = tm.matchId where m.gameEventId = @pv_GameEventId and case when tm.alliance = 'R' then m.redAlliancePoints when tm.alliance = 'B' then m.blueAlliancePoints else 0 end > 0 and (select coalesce(sum(tsp.intTeamScorePortion), 0) from v_TeamScorePortion tsp where tsp.gameEventId = m.gameEventId and tsp.matchId = tm.matchid) = 0; end end

begin -- Update scout record objectives for data specific to a team from TBA update ScoutObjectiveRecord set integerValue = (select tmo.integervalue from TeamMatchObjective tmo inner join TeamMatch tm on tm.id = tmo.teamMatchId inner join ScoutRecord sr on sr.teamId = tm.teamId and sr.matchId = tm.matchId where ScoutObjectiveRecord.scoutRecordId = sr.id and ScoutObjectiveRecord.objectiveId = tmo.objectiveId and tmo.integervalue is not null) where exists (select 1 from TeamMatchObjective tmo inner join TeamMatch tm on tm.id = tmo.teamMatchId inner join ScoutRecord sr on sr.teamId = tm.teamId and sr.matchId = tm.matchId inner join Match m on m.id = tm.matchId inner join v_GameEvent ge on ge.id = m.gameEventId where ge.loginGUID = @pv_loginGUID and ScoutObjectiveRecord.scoutRecordId = sr.id and ScoutObjectiveRecord.objectiveId = tmo.objectiveId and coalesce(ScoutObjectiveRecord.integerValue, -1) <> tmo.integerValue);
-- If match has been scouted after TBA data added, then remove the TBA scout record delete from scoutObjectiveRecord where scoutRecordId in ( select sr.id from scoutRecord sr inner join Scout s on s.id = sr.scoutId inner join Match m on m.id = sr.matchId inner join v_GameEvent ge on ge.id = m.gameEventId where s.lastName = 'TBA' and ge.loginGUID = @pv_loginGUID and exists (select 1 from ScoutRecord sr2 where sr2.matchId = sr.matchId and sr2.teamId = sr.teamId and sr2.scoutId <> sr.scoutId)); delete from scoutRecord where id in ( select sr.id from scoutRecord sr inner join Scout s on s.id = sr.scoutId inner join Match m on m.id = sr.matchId inner join v_GameEvent ge on ge.id = m.gameEventId where s.lastName = 'TBA' and ge.loginGUID = @pv_loginGUID and exists (select 1 from ScoutRecord sr2 where sr2.matchId = sr.matchId and sr2.teamId = sr.teamId and sr2.scoutId <> sr.scoutId));
-- Add partial scout records for data which comes from TBA insert into ScoutRecord (scoutId, matchId, teamId) select distinct s.id scoutId , tm.matchId , tm.teamId from Scout s , TeamMatch tm inner join TeamMatchObjective tmo on tmo.teamMatchId = tm.id inner join Match m on m.id = tm.matchId inner join v_GameEvent ge on ge.id = m.gameEventId where s.lastName = 'TBA' and ge.loginGUID = @pv_loginGUID and tmo.integerValue is not null and not exists (select 1 from ScoutRecord sr where sr.matchId = tm.matchId and sr.teamId = tm.teamId); insert into ScoutObjectiveRecord (scoutRecordId, objectiveId, integerValue) select sr.id scoutRecordId , tmo.objectiveId , tmo.integerValue from ScoutRecord sr inner join Scout s on s.id = sr.scoutId inner join TeamMatch tm on tm.matchId = sr.matchId and tm.teamId = sr.teamId inner join TeamMatchObjective tmo on tmo.teamMatchId = tm.id inner join Match m on m.id = tm.matchId inner join v_GameEvent ge on ge.id = m.gameEventId where s.lastName = 'TBA' and ge.loginGUID = @pv_loginGUID and tmo.integerValue is not null and not exists (select 1 from ScoutObjectiveRecord sor where sor.scoutRecordId = sr.id and sor.objectiveId = tmo.objectiveId);
-- If alliance objective data from TBA is zero, then set all teams in alliance objective to zero update ScoutObjectiveRecord set integerValue = 0 where id in ( select sor.id from MatchObjective mo inner join Match m on m.id = mo.matchId inner join v_GameEvent ge on ge.id = m.gameEventId inner join TeamMatch tm on tm.matchId = mo.matchId and tm.alliance = mo.alliance inner join ScoutRecord sr on sr.matchId = tm.matchId and sr.teamId = tm.teamId inner join ScoutObjectiveRecord sor on sor.scoutRecordId = sr.id and sor.objectiveId = mo.objectiveId where ge.loginGUID = @pv_loginGUID and mo.integerValue = 0 and coalesce(sor.integerValue, -999) <> 0); insert into ScoutObjectiveRecord (scoutRecordId, objectiveId, integerValue) select sr.id scoutRecordId , mo.objectiveId , mo.integerValue from ScoutRecord sr inner join Match m on m.id = sr.matchId inner join MatchObjective mo on mo.matchId = m.id inner join v_GameEvent ge on ge.id = m.gameEventId inner join TeamMatch tm on tm.matchId = sr.matchId and tm.teamId = sr.teamId and tm.alliance = mo.alliance where ge.loginGUID = @pv_loginGUID and mo.integerValue = 0 and not exists (select 1 from ScoutObjectiveRecord sor where sor.scoutRecordId = sr.id and sor.objectiveId = mo.objectiveId);
-- If alliance objective data from TBA is lower than any one team's objective value, then lower the team's objective value to TBA update ScoutObjectiveRecord set integerValue = (select mo.integerValue from MatchObjective mo inner join Match m on m.id = mo.matchId inner join GameEvent ge on ge.id = m.gameEventId inner join TeamMatch tm on tm.matchId = mo.matchId and tm.alliance = mo.alliance inner join ScoutRecord sr on sr.matchId = tm.matchId and sr.teamId = tm.teamId where sr.id = ScoutObjectiveRecord.scoutRecordId and mo.objectiveId = ScoutObjectiveRecord.objectiveId) where id in ( select sor.id from MatchObjective mo inner join Match m on m.id = mo.matchId inner join v_GameEvent ge on ge.id = m.gameEventId inner join TeamMatch tm on tm.matchId = mo.matchId and tm.alliance = mo.alliance inner join ScoutRecord sr on sr.matchId = tm.matchId and sr.teamId = tm.teamId inner join ScoutObjectiveRecord sor on sor.scoutRecordId = sr.id and sor.objectiveId = mo.objectiveId where ge.loginGUID = @pv_loginGUID and coalesce(sor.integerValue, -999) > mo.integerValue); end

BEGIN create table #AvgTeamRecord(teamId int , gameId int , rankName varchar(64) , sortOrder int , cntMatches int , value numeric(38, 6) , rank integer , rankingPointAverage numeric(10, 3) , teamGameEventId int); SET NOCOUNT ON
-- Populate local temporary table of team average scores. This improves overall query performance INSERT INTO #AvgTeamRecord select atr.teamId , r.gameId , r.name rankName , r.sortOrder , atr.cntMatches , sum(case when r.type = 'V' then case when o.sortOrder = 1 then atr.integerValue1 when o.sortOrder = 2 then atr.integerValue2 when o.sortOrder = 3 then atr.integerValue3 when o.sortOrder = 4 then atr.integerValue4 when o.sortOrder = 5 then atr.integerValue5 when o.sortOrder = 6 then atr.integerValue6 when o.sortOrder = 7 then atr.integerValue7 when o.sortOrder = 8 then atr.integerValue8 when o.sortOrder = 9 then atr.integerValue9 when o.sortOrder = 10 then atr.integerValue10 when o.sortOrder = 11 then atr.integerValue11 when o.sortOrder = 12 then atr.integerValue12 when o.sortOrder = 13 then atr.integerValue13 when o.sortOrder = 14 then atr.integerValue14 when o.sortOrder = 15 then atr.integerValue15 when o.sortOrder = 16 then atr.integerValue16 when o.sortOrder = 17 then atr.integerValue17 when o.sortOrder = 18 then atr.integerValue18 when o.sortOrder = 19 then atr.integerValue19 when o.sortOrder = 20 then atr.integerValue20 else null end when r.type = 'S' then case when o.sortOrder = 1 then atr.scoreValue1 when o.sortOrder = 2 then atr.scoreValue2 when o.sortOrder = 3 then atr.scoreValue3 when o.sortOrder = 4 then atr.scoreValue4 when o.sortOrder = 5 then atr.scoreValue5 when o.sortOrder = 6 then atr.scoreValue6 when o.sortOrder = 7 then atr.scoreValue7 when o.sortOrder = 8 then atr.scoreValue8 when o.sortOrder = 9 then atr.scoreValue9 when o.sortOrder = 10 then atr.scoreValue10 when o.sortOrder = 11 then atr.scoreValue11 when o.sortOrder = 12 then atr.scoreValue12 when o.sortOrder = 13 then atr.scoreValue13 when o.sortOrder = 14 then atr.scoreValue14 when o.sortOrder = 15 then atr.scoreValue15 when o.sortOrder = 16 then atr.scoreValue16 when o.sortOrder = 17 then atr.scoreValue17 when o.sortOrder = 18 then atr.scoreValue18 when o.sortOrder = 19 then atr.scoreValue19 when o.sortOrder = 20 then atr.scoreValue20 else null end else null end) value , tge.rank , tge.rankingPointAverage , tge.id teamGameEventId from rank r inner join RankObjective ro on ro.rankId = r.id inner join Objective o on o.id = ro.objectiveId inner join v_GameEvent ge on ge.gameId = o.gameId inner join TeamGameEvent tge on ge.id = tge.gameEventId inner join v_AvgTeamRecord atr on atr.teamId = tge.teamId and atr.loginGUID = ge.loginGUID where ge.loginGUID = @pv_loginGUID and r.name = 'Scr Imp' group by atr.teamId , r.gameId , r.name , r.sortOrder , atr.cntMatches , tge.rank , tge.rankingPointAverage , tge.id;
-- Add teams that do not have a scout record yet INSERT INTO #AvgTeamRecord select tge.teamId , r.gameId , r.name rankName , r.sortOrder , 0 cntMatches , 0 value , tge.rank , tge.rankingPointAverage , tge.id teamGameEventId from rank r inner join v_GameEvent ge on ge.gameId = r.gameId inner join TeamGameEvent tge on tge.gameEventId = ge.id where ge.loginGUID = @pv_loginGUID and r.name = 'Scr Imp' and not exists (select 1 from #AvgTeamRecord atr where atr.TeamId = tge.teamId);
-- Update Scoring Impact for Teams update tge set scoringRank = subquery.rank , scoringAverage = subquery.value from TeamGameEvent tge inner join (select atr.teamGameEventId , atr.value , (select count(*) from #AvgTeamRecord atr2 where atr2.gameId = atr.gameId and atr2.rankName = atr.rankName and atr2.sortOrder = atr.sortOrder and atr2.value > atr.value) + 1 rank from #AvgTeamRecord atr where atr.rankName = 'Scr Imp') subquery on subquery.teamGameEventId = tge.id;
END
